import BitArray from '@zxing/library/es2015/core/common/BitArray';
import DecodeHintType from '@zxing/library/es2015/core/DecodeHintType';
import Result from '@zxing/library/es2015/core/Result';
import OneDReader from '@zxing/library/es2015/core/oned/OneDReader';
/**
 * <p>A reader that can read all available UPC/EAN formats. If a caller wants to try to
 * read all such formats, it is most efficient to use this implementation rather than invoke
 * individual readers.</p>
 *
 * @author Sean Owen
 */
export default class MultiFormatUPCEANReader extends OneDReader {
    private readers;
    constructor(hints?: Map<DecodeHintType, any>);
    decodeRow(rowNumber: number, row: BitArray, hints?: Map<DecodeHintType, any>): Result;
    reset(): void;
}
